import React from "react";
import Main from "../../Templates/Main/Main";
import "./Home.css";

const Home = () => {
  return (
    <Main>
      <div className="home-card">
        <div className="display-4">Bem Vindo</div>
        <hr />
        <p className="mb-0">
          Nossa plataforma permite que você consulte o preço das ações e
          acompanhe as maiores empresas do Brasil!
        </p>
      </div>
    </Main>
  );
};

export default Home;
